INSERT INTO `catalogs` VALUES (1,1,'婚庆系列','1455587875595',NULL,'十年修得同船渡，百年修得共枕眠。|情人眼里爱相随，一生一世成双对。|以爱得名义,此生不渝!|百年好合，永结同心！|新婚快乐，早生贵子！','用细节成就您的美好婚礼',NULL,NULL),(2,2,'纪念收藏系列','1455587890580',NULL,'无论经过多少岁月，无论走过多少路程，彼此感情永不变，一生一世的好兄弟|愿多年以后我们还是好友，一起喝掉这坛老酒。|朋友是天，朋友是地，有了朋友我们可以顶天立地，朋友是风，朋友是雨，有了朋友可以呼风唤雨。','愿多年后我们还是好友',NULL,NULL),(3,3,'祝寿生日系列','1455587899127',NULL,'祝老寿星：寿比南山，福如东海！|祝小宝宝健康成长，平安快乐！| 最美不过夕阳红，祝老寿星老当益壮，龙马精神！|祝老寿星：瑶觞春介齐眉寿，锦砌晖承绕膝花！|百年百月百天，长久长顺长安。','定制诠释自己心意',NULL,NULL),(4,4,'企业店庆系列','1455588144291',NULL,'今天是个喜庆的日子，愿公司步步高升！财源广进|这杯酒，是祝愿的酒，祝愿未来的岁月中，我们的友情更深、生意更旺！|庆祝公司成立十周年','企业活动宴席必不可少',NULL,NULL),(5,5,'升值收藏系列','1455587916565',NULL,'看今朝，欢聚一堂，笑谈当年。|人走千里友谊在，大树之间根连根，朋友之间心连心|刻下最完美的时刻','收藏铭记最重要的时刻',NULL,NULL),(6,6,'招待系列','1455587925440',NULL,'有语云：无酒，何以逢知己；无酒，何以壮行色。让我们举起杯,为我们灿烂美好的明天干杯！|让我们欢饮美酒，一起分享这个难忘的夜晚。|这杯酒，是祝福的酒，祝福大家身体健康、万事如意！','专属宴请招待用酒',NULL,NULL),(7,7,'感恩系列','1455591470465',NULL,'我也许不是您最出色的员工，而您却是我最崇敬的领导！|老师，您辛苦了！我愿是一束夜来香，和星星一起陪伴在您身旁|谢谢你愿意走进我的生命，扮演朋友的角色!','所有感谢尽在龙鑫定制酒',NULL,NULL),(8,8,'个性化系列','1455588018271',NULL,'人生难得几回醉，今日美酒最香甜。|酒逢知己千杯少，酒壮英雄胆，酒后吐真言，喝酒论英雄。|朋友总是心连心，知心朋友值千金，时刻勿忘朋友心。| 致我们即将逝去的青葱岁月','张扬专属我的个性',NULL,NULL),(9,9,'励志系列','1455588026099',NULL,'人之所以能，是因为相信能！|既然选择了前方，便只顾风雨兼程！|奋斗，精彩时刻干一杯！','励志系列专属',NULL,NULL),(10,10,'经典系列','1455588033022',NULL,'忆往昔，岁月峥嵘，思绪万千。|百般努力终重逢，执手相看，感慨何止万千。|共祝愿，手和手相握，心和心靠近。','经典铭记于心',NULL,NULL),(11,11,'酒具酒杯','1455588039834',NULL,'人生得意须尽欢,莫使金樽空对月。|举杯邀明月，对影成三人。','美酒好伴侣',NULL,NULL),(13,12,'节庆系列','1455591480263',NULL,'给你拜年了：新年好!|元旦佳节到，祝新年快乐！|妈妈，在母亲的节日里，我祝福您幸福快乐!|朋友，祝您端午节快乐!|年年圆满如意，月月事事顺心！','专属节日祝福',NULL,NULL);

