INSERT INTO `infos` VALUES (1,'广告','1',NULL,NULL,'1451901378737',NULL,NULL,'2016-01-04 17:00:47',NULL,NULL),(2,'广告','1',NULL,NULL,'1451901374453',NULL,NULL,'2016-01-04 17:00:47',NULL,NULL),(3,'广告','1',NULL,NULL,'1451901372102',NULL,NULL,'2016-01-04 17:00:47',NULL,NULL),(5,'新闻','中国酒文化--- 传承、传统、传说、传奇','222','333','1456206739377','1456206741970',NULL,'2016-02-05 16:25:19','中国酒文化源远流长，品种繁多，名酒荟萃，享誉中外。酒渗透于整个中华五千年的文化史中，从文学艺术创作、文化娱乐到饮食烹饪、养生保健等各方面在中国人生活中都占有重要的位置。<br><br>   \n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;酒乃天地间之尤物。虽也进入肚腹，却不能充饥，不能解渴，只作用于人的心神。心神的滋润与刺激，带来奇妙变化和莫名诡谲。世间有酒，生活丰富了，历史斑斓了，迷茫尘寰多了些有趣的风景，短短人生增添丰富的滋味。或宫廷，或市井，或高贵，或卑贱……宫廷天子赐宴，乡村老翁对酌，档次不同，气派迥异，无论是佳酿或酒醅，品味的美妙，则是一样的。<br> <br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;酒文化是中华民族饮食文化的一个重要组成部分，他的历史几乎与人类文化史一道开始。作为一种物质文化，酒的形态多种多样，其发展历程与经济发展史同步。而酒更具有精神文化价值，体现在社会政治生活、文学艺术乃至人的人生态度、审美情趣等诸多方面。与其说酒是物质享受，不如说它是精神感受，正所谓“醉翁之意不在酒”。<br><br>  \n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;中国作为卓立世界的文化古国，五千年历史长河，酒和酒类文化一直贯穿始终，几乎渗透到社会生活的各个领域。中国历来是一个以农立国的国家，政治、经济活动都以农业为立足点。而酒绝大部分是以粮食酿造的，紧紧依附于农业，成为农行经济的一部分。酒业兴衰也鉴粮食的丰歉。<br><br>','55'),(7,'新闻','中国人送礼，为什么会选择白酒？',NULL,NULL,'1456197039592','1456197042435',NULL,'2016-02-23 11:10:20','逢年过节送礼，是送一份情谊，一份温暖。如今，节庆送礼，选择的礼物是越来越丰富，烟酒茶都在礼品单之列，白酒更是热门礼品之一。那么，为什么中国人送礼喜欢送白酒呢？ <br><br>\n\n★理由一  白酒存放时间久，有收藏价值 <br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;白酒一大特点是越陈越香！白酒只要存放得当，放一两年甚至十来年都不会坏，而且好酒陈酿越久越有味道。当时光远去，某一天朋友拿出你送的白酒，不由得心怀感激地想起当天的情景——这时，“礼物”的含义才真正被诠释到最佳。而且，高品质的白酒具有极高的收藏价值，珍藏情意、坐等升值啊！  <br><br><br>\n\n★理由二 送白酒就是送健康 <br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;白酒是一种健康的酒品，适量饮用白酒对人体有很多好处，很多老人的长寿秘诀就是喜欢喝白酒。白酒中含有机酸类、不饱和脂肪酸类、杂环类化合物和酚类化合物含量非常丰富，其中有些成分具有医疗保健作用。 更重要的是酒中金属离子锌、镁等含量非常高，在白酒中形成胶体物质，有益人体健康；白酒中的功能性成分有利于减轻肝脏的损伤；白酒中的微量成分四甲基吡嗪是有益人体健康的功能性因子，不过只有纯粮酒才有这种功效的。  <br><br><br>\n\n★理由三 送白酒才有有品位 <br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;喜欢喝白酒的人，大都收入稳定，注重生活品质，有自己的生活品位。送一款优质白酒，无疑是送人一份有品位的情谊，让人欢喜。而且白酒时尚靓丽的瓶装和优雅精致的酒盒包装，又让节日的气氛更加喜庆。<br><br><br>\n\n★理由四 白酒适合聚餐 <br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;逢年过节是团圆的日子，亲朋好友聚餐必不可少，那么，白酒它是餐桌上最不可或缺的饮品，红酒配红肉、白酒配白肉，好吃又好喝。在中国，白酒拥有广泛的配餐适应度，搭配烤鸭、烤鱼、火锅、川菜、烤肉、美容猪蹄……莫不相得益彰，别有一番风情。  <br><br><br>',NULL),(8,'新闻','酱香型白酒为什么贵？专家给你算一笔账！',NULL,NULL,'1456206528826','1456206531904',NULL,'2016-02-23 13:48:36','对于酒友来说，不管是送亲朋好友，还是给自己，一瓶好酒当礼物，是再好不过的。譬如一瓶酱香型白酒，不仅可以喝得健康，喝得劲爽，还能当作收藏，一酒多得，其乐无穷。<br><br>\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;可为什么酱香白酒动辄上千元，一度还卖到两千元以上？来听专家给你算一笔账吧。<br><br>\n\n①地理环境不可复制——水<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;白酒酿造讲究“水、土、气、生”。这里有着赤水河的滋养和星罗棋布的泉水，根据当地地质部门的检测，赤水河含有多种微量元素，如钾、钙、镁、铁、硫、磷、锰、铜、锌、硒等，遵义地区地层的深井，与赤水河地下相通连，井水中也含有这些微量元素。\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;酿造用水，呈无色、透明、无臭、微甜、爽净，水的总硬度为9.46，pH值为7～7.8，固形物中含有对身体有益的成分，这种泉水适于酱香白酒酿制。<br><br>\n\n②地理环境不可复制——土壤<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;“龍鑫浩然”酒产区以茅台镇为核心，整个产区沿赤水河谷遍布的紫色砂页岩、砾岩形成于7000万年以前，土壤表面广泛培育着的紫色土层，酸碱适度，无论地面水和地下水都通过两岸的紫土层流入赤水河中，溶解了多种对人体有益的微量元素，这些土壤做窖泥有益于酿造优质酱香酒。<br><br>\n\n③地理环境不可复制——气候<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;赤水河谷冬暖夏热少雨的独特小气候造就了“龍鑫浩然”酒产区内以茅台镇为代表的优质酱酒产生。<br><br>\n\n④地理环境不可复制——微生物环境<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;“龍鑫浩然”酒产区独特的赤水河、土壤、气候等等都导致这里的微生物富集，我们曾经研究过，这里以茅台镇为核心，空气中微生物夏季有细菌72种分属32个属，真菌53种分属33个属，水中细菌178种分属82个属。<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;这些微生物造就了好酒的产生。还有“龍鑫浩然”酒产区的原材料，酱香酒酿造所用粮食为赤水河畔出产高粱，颗粒大而量高，淀粉高富含氨基酸，单宁含量适中，是酿造上乘白酒的极品原料。<br><br>\n\n<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;那么问题来了，酒友们有列入收藏的酒吗?酱香型白酒当作收藏品，可不只是爱好而已，就收藏市场来说，它也是最适合用作收藏的白酒。这是为什么呢?<br><br>\n\n1、酱香型白酒的独一无二性<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;特殊的酿造工艺，决定了酱香型白酒，能够充分利用微生物群并发挥他们自身的效应，使其达到“越陈越香”的境界。包括黔酒在内的酱香型白酒，都是纯粮酿造自然发酵的纯天然产品，不添加任何香味成分(色素、甜味剂、香精等)，这在国内外名酒中，都是独一无二的。<br><br>\n2、酱香型白酒越陈越香的秘密<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;绝大多数白酒之所以无法做到越陈越香，主要原因就是长时间存放，酒中的\"添加成分\"逐渐挥发，相应的香气也就会逐渐降低。酱香型白酒能够保证越老越好、越陈越香，绝不添加任何外来物质，是非常重要的原因。必须用原浆酒勾原浆酒，其最后确立的酒精度是用不同酒精度的原浆调和而成，不用水降度，也不用其它任何添加剂，方能使酒体形成\"酱香突出、优雅细腻、酒体醇厚、回味悠久、空杯留香\"的鲜明风格。这就排除了添加任何香气、香味物质的可能。<br><br>\n\n3、酱香型白酒的储存稳定性<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;酱香型白酒的酒精浓度科学合理，一般在53度左右，此时，水分子和酒精分子结合最牢固。另外，酱香型酒的储存期较长，游离的酒分子少。酱香型白酒浓度稳定的特性，这在所有国内外蒸馏酒中也是独一无二的。一些低度酱香型白酒存放若干年后，酱香依然浓郁，也是酒精浓度稳定的缘故。<br><br>\n4、酱香型白酒的健康安全性<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;酱香型白酒高温制酒、易挥发物质少。酱香型白酒蒸馏时，接酒温度高达40度以上，比其它白酒高出近一倍。高温下易挥发物质挥发掉很多，加之三年以上储存，损失高达2%以上，带走大部分易挥发物质，经年陈放后的酒体自然对人体的刺激少，有利于健康。<br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;酱香型白酒是天然发酵产品，酸度高、酚类货物多。纯粮酿造，天然发酵，是酱香型白酒独特的工艺特性，其产出的白酒，酸度是其它品种白酒的3-5倍，而中西医均认为，食酸有利健康;酚类化合物是其它白酒的3-4倍，研究表明，酚类化合物有利于预防血管疾病。\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;酱香型白酒严格执行至少3年的陈放期，使酒体更趋于醇熟，出厂的产品质量稳定。洞藏时间在10年以上，酒品更加稳定，对身体刺激性小。<br><br>\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;有独一无二的品性，能健康安全地品鉴，受得起储存时间的考验，越陈越香。这是酱香酒白酒受人青睐的原因，也是它值得收藏的原因。<br>',NULL),(9,'新闻','为什么懂白酒的男人都有魅力？',NULL,NULL,'1456207176072','1456207074617',NULL,'2016-02-23 13:55:46','因为，白酒，形似水，性似火，萃五谷之精华，采日月之灵气，恰如长发及腰、风华正好的你，得父母之宠爱，享亲友之呵护，外表波澜不惊、静若处子，内心却热情洋溢、渴望真爱。所以，懂白酒的男人，才会更懂你，懂你的柔情似水，懂你的热情如火。<br><br>\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;因为，白酒，不仅高粱为肉，小麦为骨，甘泉注血，更历得烈火中烧，经得岁月历练，恰如懂白酒的男人，在时光的打磨后，精神饱满、心性成熟、性格内敛、耐得寻味。所以，懂白酒的男人，才最经得起你品味，醇厚馥郁，入口难忘。<br><br>\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;因为，白酒，无论是生意场上，还是仕途之中，都是必备的杯中之物，更是男人事业上必不可少的应用媒介。多少生意，多少升迁，谈在办公之所，成在喝酒之桌。所以，懂白酒的男人，能带给女人更多归属感和安全感。<br><br>\n\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;因为，白酒，既有消愁除忧之功，也有遣怀助兴之能，懂白酒的男人，在你逢喜事好事时，与你小酌增欢，在你不悦不爽时，为你解忧散闷。所以，懂白酒的男人，能够让心爱的女人少些郁郁寡欢，多些如花笑颜。<br><br>\n\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;因为，白酒，对身体的影响也有差别，酒虽容易让人微醺、沉醉、而粮食酒不仅过口留香，而且喝后舒服、安康，所以懂白酒的男人能够让心爱的女人多些享受，少些担忧。<br><br>\n\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;因为，白酒，少饮则消愁解闷、助兴遣怀，但过饮则败坏酒兴、伤身伤人，喝多了酒的男人，容易在酒桌上乱说话，回到家发酒疯，甚至酒驾还会被罚、被押等。所以，懂白酒的男人，不必让心爱的女人操心，不会让心爱的女人担心，更不会让心爱的女人受怕。<br><br>\n\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;因为，白酒，是承载情义的最佳载体，无论是桃园结义还是竹林七贤，朋友相交相聚，均无酒不行，聊得开心，喝得畅快。物以类聚，人以群分，懂白酒的男人，重情重义。所以，懂白酒的男人，往往对朋友诚心、真心，对女人也专情、忠心。<br><br>\n\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;因为，白酒，乃百药之长，曾经是古代帝王颐养天下，父母终老所享的最好之物，喝一杯白酒，相当于吃了57味中药，对于熟络筋骨、贯通血脉、调和阴阳等，有着其他饮品不可比拟的功效。所以，懂白酒的男人，身体更健康，活得更长久，与女人恩爱的日子也更绵长。<br><br>\n\n\n\n龙鑫酒业温馨提醒您<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;好酒在“品”，龙鑫酒业出品的“龙鑫浩然”系列酱香型白酒，提倡“品”酒的文化，让喝酒慢下来，“龙鑫浩然”酒虽好，但也不要贪杯哦！',NULL),(10,'新闻','喝白酒相当于服57种中药',NULL,NULL,'1456207364687','1456207368593',NULL,'2016-02-23 14:02:07','说到喝酒，高富帅的美男们，一定有妹子在饭桌这样“拉拢”你们：白酒对身体不好，还是喝红酒吧？其实白酒和红酒到底哪种更好呢？今天小编就跟大家科普科普~~<br><br>\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;白酒保健功能大于葡萄酒，而且前者比后者更洁净、更保健。因为中国传统白酒采用多菌系自然堆积固态方式制曲、多维微生物固态发酵酿造和高温蒸馏工艺，在固态蒸馏过程中将产品中的风味物质进行了选择与纯化；而葡萄酒为酿造酒，更多的风味物质来自于葡萄原料和后期的橡木桶陈酿。 <br><br>\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;你可能想不到吧？白酒生物活性成分之多是世界酒类之最，达到了近1500种。这些白酒生物活性成分能够缓解酒精伤害，能增强人体防御功能、调节生理节奏，以及预防疾病和促进康复等，因此，如果适量饮用白酒，是非常有利健康的。 <br><br>\n\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;这样一说，似乎还真的是很有道理的吧？而且，还有历史印证呢，咱们中国不是有句老话：“酒是粮食精”吗？什么最养生，当然是五谷杂粮，而白酒，就是从这五谷杂粮中提取出来的精华啊。 <br><br>\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;原来，从白酒所含的微量成分来看，确实有机物的种类非常丰富。这还不是重点哦，重点是：这些功能性成分来自自然发酵，与中药材均为天地同醸，且都有同归自然的属性。<br><br>\n\n\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;喝正宗酱香白酒，就选龍鑫浩然定制酒！产自国酒之乡贵州茅台镇，我们坚守传承茅台镇酿酒传统工艺，传递东方古老酱香型白酒养生文化，专注为个人收藏、企业庆典、婚宴、私人聚会、生日、寿宴、社交送礼等提供个性化定制酒服务！<br><br>\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;龍鑫浩然定制酒商城线上线下多系列新产品已经上架，更多主题产品将陆续上架，欢迎选购定制，关注本公众号进入购酒商城，开始定制专属您的健康白酒！<br><br>',NULL),(11,'新闻','酱香型白酒为什么越陈越香?',NULL,NULL,'1456207514909','1456207518862',NULL,'2016-02-23 14:05:08','常言道：酒是陈的香，实际上，白酒界权威专家指出，并不是所有的白酒都能达到如此境界，而只是茅台酱香型酒等极少数真正靠纯天然酿造、绝无任何添加剂的极品酱香白酒所拥有的专利。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;相比较而言，一般白酒随着时间的推移，添加成分会逐渐挥发，相应，香气与价值也就会逐渐降低。这就是为什么有时候我们打开一瓶上了年头的一些白酒，会有敞气、不够味儿的感觉的缘故。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;茅台酱香型酒能够名副其实，真正做到越老越好、越陈越香，归根到底，恰恰就在于其在所有的白酒中，是不添加任何易挥发的香味成分、全靠自然发酵的纯天然产品。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;也因此，在所有白酒品种收藏中，酱香型白酒最适合收藏。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;茅台酱香型酒的传统工艺是端午踩曲，重阳投料，一个生产周期是一年，再经过三年以上的陈酿窖存，加上原料进厂、勾兑存放的时间，平均酒龄至少5年才能出产品。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;如此悬殊的时间不等式，建立于茅台人对陈酿环节独具一格的见解：刚酿出的新酒，由于含有醛类和硫化物等低沸点杂质，难免有暴辣、冲鼻、刺激性大的缺点，通过陈酿贮存，酒液自身的氧化还原和脂化等化学变化、物理变化就有效地排除了酒的低沸点杂质，使乙醛缩合，辛辣味减少，变得柔和、绵软，增加了芳香。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;茅台酱香型酒的勾兑环节堪称艺术与技术的完美结合。为达到色、香、味俱佳的效果，陈酿结束后，还需要不同浓度、不同轮次、不同酒龄的酱香、窖底香等三类香型的单型酒来调配融汇，才能勾兑最后的成品茅台酱香型酒。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;茅台酱香型酒越老越好、越陈越香，使得其具有了极大收藏价值，也为茅台年份酒的推出奠定了基础。<br><br>',NULL),(12,'新闻','龍鑫浩然定制酒——不平庸的DNA',NULL,NULL,'1456210147945','1456210151727',NULL,'2016-02-23 14:07:11','龍鑫浩然定制酒原产地是地处国酒之乡、神秘的赤水河畔的茅台镇，拥有有7.5万平方公里酱酒核心产区，龍鑫厂址占地面积300亩，离茅台集团一厂500米，拥有3项国家白酒酿造专利技术，是茅台镇三大酱酒品牌之一。<br><br>\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;龍鑫浩然定制酒原产地酒厂创建于1818年，迄今近200年历史。是国内酱香型白酒类集科研、生产、销售、管理与服务为一体，并享有“植物埋藏法”知识产权的股份制大型白酒企业，荣居贵州省仁怀市三大明星企业之一。<br><br>\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;企业占地面积600亩，员工500余人，拥有酿造车间30个、酱香窖池600多个、万吨酒库3个、现代化自动生产线3条，年产量6000余吨、库存酒量22500吨，是名副其实的全国酱香型原酒生产大型企业。<br><br>公司通过了ISO9001-2008国际质量管理体系认证, 获得了“贵州省著名商标”、“绿色消费企业认证”、“贵州省AAA级信用企业”等荣誉。所生产的产品由太平洋保险公司作质量承保。<br><br>\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;目前，公司产品畅销全国34个省市自治区，并逐步拓展海外市场。由黔澳国际投资有限公司在台湾、东南亚独家代理销售，出口量1900吨，出口额高达七亿八千八百万元，居中国酒业出口量之首，堪称贵州酒业的又一奇迹。<br><br>\n\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;被列为贵州省重点培育的龍鑫浩然酒原产地酒厂是贵州仅次于茅台的第二大酱香型酒厂,立争打造紧跟茅台酒之后的第二大品牌。龍鑫酒业犹如一艘航空母舰，胸怀壮志，蓄势待发,势必引领中国酱香型白酒的辉煌明天！<br><br>',NULL),(13,'新闻','龍鑫浩然白酒定制，见证每个重要时刻',NULL,NULL,'1457181478257','1456210539955',NULL,'2016-02-23 14:14:06','定制酒是指酒水企业根据客户的特定需求，从品质和形象设计着手为客户量身打造出具有浓郁个人专属风格的酒水，是一种“一对一”式的高品质服务产品。与一般用酒相比，定制酒打上了用户的风格烙印，具有更多的个性元素和纪念意义。<br><br><br>\n\n\n\n龙鑫浩然定制酒 — 婚庆系列<br><br>\n用细节成就您的美好婚礼<br>\n牵了手<br>\n便永不放松<br>\n只求在最美的年华里<br>\n定制值得留念的瞬间<br><br><br>\n\n\n龙鑫浩然定制酒 — 纪念收藏系列<br><br>\n愿多年后我们还是好友<br>\n天涯路远<br>\n陈年烈酒<br>\n举杯共饮<br>\n切莫将昔日遗忘<br><br><br>\n\n\n龙鑫浩然定制酒 — 祝寿生日系列<br><br>\n定制诠释自己心意 <br>\n够气势，有面子<br>\n馈赠佳品<br>\n美好记忆酒香永传<br><br><br>\n\n\n龙鑫浩然定制酒 — 企业店庆系列<br><br>\n企业宴席活动必不可少<br>\n欢庆时刻畅饮企业定制酒<br>\n自豪感油然而生<br>\n专业定制更有身份<br><br><br>\n\n\n龙鑫浩然定制酒 — 升值收藏系列<br><br>\n收藏铭记最重要的时刻<br>\n每一次改变<br>\n每一次成就<br>\n都值得被纪念<br><br><br>\n\n\n\n龙鑫浩然定制酒 — 招待宴请系列<br><br>\n专属宴请招待用酒<br>\n够气势、有面子<br>\n展现企业实力<br>\n为客户留下深刻印象<br>\n助力企业商务谈判成功<br><br><br>\n\n\n\n龙鑫浩然定制酒 — 感恩系列<br><br>\n所有感谢尽在龙鑫定制酒<br>\n十年树木<br>\n百年树人<br>\n繁星纵变<br>\n师恩永忆<br><br><br>\n\n\n龙鑫浩然定制酒 — 私人化定制系列<br><br>\n张扬专属我的个性<br>\n就是要追求独特<br>\n就是要与众不同<br><br><br>\n\n\n\n龙鑫浩然定制酒 — 励志系列<br><br>\n激励自己，激励人生<br>\n人生路漫漫<br>\n给自己一个微笑<br>\n斟一杯酒<br>\n且凭美酒长精神 <br><br><br>\n\n\n\n\n在这里，您就是艺术家<br>\n最具创新的酱香型白酒，将您最真实的想法完美实现<br>\n您有什么想法？<br>\n马上告诉我们<br>\n我们去帮您在酒瓶上实现<br>\n只为让您与众不同<br><br><br>',NULL),(15,'新闻','龙鑫酒业教你如何能快速的醒酒',NULL,NULL,'1456380499712','1456380502243',NULL,'2016-02-25 14:08:07','影响醒酒的主要因素有空气的质量、温度、气压和温度。在龙鑫企业定制酒公司称，温度、气压以及湿度等醒酒环境难以改变，但是空气质量是可以物力手段提纯的。通过“创造”干燥、洁净、高纯度的氧气环境来与酒液恒压、均匀地接触、从而达到醒酒目的的正是 智能侍酒器的关键所在。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;而对于烈性酒的醇酒原理，专家表示：通过向烈性酒加纯净的氧气可以加快酒体醇厚，起到柔化口感的作用。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;对此，白酒企业定制酒专家表示，对于白酒而言，加氧催陈原理并不陌生，只是之前都用于酒体储存环节；而智能侍酒师将这种加氧醇酒功能运用到终端服务，可谓一大创新；而其醇酒类、醛类等物质含量，改变酸、酯结构；可以有效地降低酒体刺激性和异杂味，增强舒适感。<br><br>',NULL),(16,'新闻','个性定制酒走上互联网+模式',NULL,NULL,'1456381251738','1456381255269',NULL,'2016-02-25 14:18:37','现在很多企业都在走互联网+模式，在个性定制酒公司行业，龙鑫酒业首先开启互联网大数据模式，走在了同行的前列。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;互联网个性定制酒在设计上的一个共同点，就是现在设计理念的核心部分——追求简洁，不喜繁复。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;现在工业理念的核心，就是追求简洁。一位酒类包装设计师表示，在古典文艺时代，繁复的线条、丰富的色彩是主流，但是现在工业条件下，任何一种商品的外形构造、包装构造，都以制造机器能够快速加工成型的线条为主，这就构成了简洁为上的客观条件。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;从受众心理而言，日益加快的生活和工作节奏已经不容许消费者对于工业品静静欣赏，这也导致了对于简洁化外形与色系的偏爱。在互联网时代，这种趋向更为明显。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;龍鑫浩然定制酒同样如此，其在包装上进行了创新，包装及其精简，并没有进行过为复杂的包装，能够满足当下年轻人对于口感、包装等的审美和需求。<br><br>\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;传统白酒产品的过度包装，导致很多消费者的反感，尤其是年轻消费群体表现的更为明显，为了能够真正迎合这类消费群体的需求，龙鑫酒业在进行包装时比较精简而在文字的撰写上运用了更类似与网络流行语的文字，既显得非常的传统，个性，又能抓住万千年轻消费者的心理，而这种直接标示互联网用语，而非古典诗词的方式，企业定制酒也成为互联网白酒设计的一个“标配”！<br><br>',NULL),(17,'新闻','个性化定制白酒凸显价值与尊贵',NULL,NULL,'1457181369582','1457181464882',NULL,'2016-03-05 20:26:36','现在很多企业年会，婚宴，寿宴等都用自己的个性化定制白酒，这样一来是凸显自己公司价值体系，二是体现了它的独一无二，匠心独运之处。\n珠海个性化定制酒龙总称：当我看见它的第一眼就被它征服：时尚、个性、孤品。独一无二的外观设计，充满华丽时尚与奢华感。拿在手中，她不再是无生命的物件，而是一件活生生的艺术品。\n龙鑫定制白酒公司打造的个性化定制酒不仅在整体基调上卓越超凡，而且在每个细节上也无可挑剔。无论从美感、质感、还是珍藏的角度去欣赏，她都有着独特的精神气质和人文魅力，足以能把人的一种梦变成一种现实。',NULL),(18,'新闻','龙鑫个性化定制酒公司满足酒水最高需求',NULL,NULL,'1457181415989','1457181470272',NULL,'2016-03-05 20:30:51','龙鑫拥有专业的设计、生产人员和完善高效的一站式服务体系。从酒水选择、个性设计、物流配送到售后服务，提供极尽全面、完善、体贴、高效的服务。最前沿的时尚元素、最高端的定制设计，最完善的后续服务，带领消费者领略奢华的艺术和时尚的生活。\n个性化定制酒满足的是个性化的差异需求。而需求的最高境界是什么?依据马斯洛的需求理论，最高层次是精神层面的需求，是超越使用价值本身的附加值，是一定意义上的奢侈品。而个性化定制酒真正价值体现源于个性化的需求升级，具有稀缺及不可替代的价值。这不是用金钱可以进行衡量的，而是精神层面上的品位和唯我独尊。同样也正是伟大的马斯洛理论金字塔的最高峰。\n龙鑫个性化定制酒服务，将匠心独具的设计结合精湛卓越的生产工艺和不计时间成本的付出，创造其不可复制的价值属性。而这种价值感，正是奢华和稀缺的要义之一，在这里，商品不再是无生命的物件，而成了活生生的艺术品，成为了有价值的藏品。',NULL),(19,'友情链接','大米真空袋',NULL,'www.zhengzhudai.com','','',NULL,'2016-03-05 20:33:35',NULL,NULL),(20,'新闻','个性定制酒成为酒水行业的新宠',NULL,NULL,'1457417617855','1457419043699',NULL,'2016-03-08 14:13:27','<span style=\"font-size:14px;\"><span style=\"font-size:16px;\">节日是扎堆送礼的时候，如果你送的礼物不显山不露水，又如何能让收礼的人印象深刻，打动人心？所以，选择礼物时要懂得另辟蹊径，拒绝雷同。相比市场上琳琅满目的礼品，个性化定制的礼品更具创意，收礼的人能体会到其中的心意，我们做过一个调查，以我们个性定制酒为例，总能得到一个很高的印象分。</span></span><br />\n<span style=\"font-size:16px;\">&nbsp; &nbsp; &nbsp; </span><span style=\"font-size:16px;\">俗话说“拿人手短”，千锤百炼的职场人士，大多对礼物都有一种本能的警惕，如何让收礼的人能安心收下而不至于良心不安压力倍增？首先，选择的礼物并非越贵重越好。如果礼物太过于贵重，收礼的人难免会有压力，拒收的可能性也就会很大。当然如果礼物太轻，很容易让人误解为瞧不起他，尤其是对关系不算亲密的人。所以，礼物的轻重一定要得当，不能过轻，也不能过重。礼物的贵重程度可以以对方能够愉快接受为尺度，这样双方都会皆大欢喜。</span><br />\n<span style=\"font-size:16px;\">&nbsp; &nbsp; &nbsp; 职场人际经更信奉“投桃报李”，想让自己职场生涯顺顺利利，送礼是必不可少的环节。但是各位正打算送礼的职场人士要注意了！职场送礼是高风险行为，礼品的选择在无形中表达着送礼者的目的及对对方的关注程度等信息，它既可帮助你赢得对方的青睐，也可以降低你在对方心中的形象。中高档酒水也是送礼中常用的，为了吸引注意力，个性化定制酒无疑就成了新的亮点。</span><br />\n<div>\n\t<br />\n</div>',NULL),(21,'新闻','喜宴定制酒有什么优势？',NULL,NULL,'1457417806548','1457419040856',NULL,'2016-03-08 14:16:05','<div>\n\t<span style=\"font-size:16px;\">现在的喜宴都是经过婚礼策划公司精心策划，为了就是别具匠心，独一无二，有一个回味长久的活动。</span><br />\n<span style=\"font-size:16px;\">&nbsp; &nbsp; &nbsp; 喜宴定制酒是由“一对一”专业设计师策划、设计，可以在红酒包装上印制新人的婚纱照、名字及祝福语等，这种个性化定制包装外盒，贴合婚礼现场主题，风格、色调搭配融合，不仅为婚礼增加亮点和特色，还可以作为回礼用，从新人的角度讲能将这份情谊谢意清楚的表达到，对于受礼者来说，他们收到的不仅仅是一支定制酒，而是一份情谊，而他们收藏的同样是这份情谊，会永久保存独一无二、毕生难忘的婚礼回忆。</span><span style=\"font-size:16px;\">珠海喜宴定制酒领导者-龙鑫酒业专业为您服务。</span><br />\n<span style=\"font-size:16px;\"></span><br />\n</div>',NULL),(22,'友情链接','奶茶加盟店',NULL,'www.34168.com','','',NULL,'2016-03-08 14:28:59',NULL,NULL),(23,'新闻','个性定制酒会成酒类行业重要增长点',NULL,NULL,'1458180678714','1458180681074',NULL,'2016-03-17 10:08:40','<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; 龙鑫个性定制酒设计师称，未来酒类行业的个人定制收藏市场，将会成为中国酒类行业发展的重要增长点，而这种增长点甚至会让中国酒类行业的市场格局发生一些变化，对这种市场的把握和运作甚至会成为一些酒类企业的核心竞争力，尤其对一些中小酒类企业而言。</span><br />\n<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;消费者在不知如何选择的时候，那么他们就会选择简单，需求开始回归原点，既然这么多的品牌和产品让我无从选择，那么好，我就只选择酒类产品本身的质量，除了这个，其他的信息我都可以屏蔽。</span><br />\n<span style=\"font-size:14px;\"> 追求心智上选择的简单和需求原点的回归，就让以酒类原酒为定制出发点的高端定制市场应运而生;同时，也需要酒类企业开始思考以消费需求原点来重新审视自己的战略和规划。</span><br />\n<p>\n\t<span style=\"font-size:14px;line-height:1.5;\">&nbsp; &nbsp; &nbsp; &nbsp;经济发展的产物</span>\n</p>\n<span style=\"font-size:14px;\"> <span style=\"font-size:14px;line-height:21px;\">&nbsp; &nbsp; &nbsp;&nbsp;</span>从各国和各行业的定制规律来看，高端定制都是在经济发展到一定时期的产物。</span><br />\n<span style=\"font-size:14px;\"> 随着经济的发展和社会财富的积累，使一部分人对产品的消费已经脱离了基本物质层面的需求，而寻求精神层面的一种追求和享受，他们对一些产品的消费也从大众转移到了个性和专属的独特层面。</span><br />\n<span style=\"font-size:14px;\"> 当然白酒行业的定制和其他行业的定制也有着其独特性，这种独特性归因于酒类产品的特殊性，比如酒水本身可以通过长时间的储存来进行价值的升值，而不单单是价格。</span><br />\n<span style=\"font-size:14px;\"> 龙鑫个性定制酒刘经理曾和几个企业家在一起聊天时，他们就曾给笔者讲，他们在自己的新房下面都准备建设一个酒窖，目的就是为了储存酒品。这样，他们以后就可以在属于自己的酒窖里取酒来招待客人。这种采购往往会以千升为计量单位。</span><br />\n<span style=\"font-size:14px;\"> <span style=\"font-size:14px;line-height:21px;\">&nbsp; &nbsp; &nbsp;&nbsp;</span>当然这种规模化的定制采购是那些具备一定经济实力的人士或团体才能进行的，而且还要投资相应的酒类储存设施。</span><br />\n<span style=\"font-size:14px;\"> <span style=\"font-size:14px;line-height:21px;\">&nbsp; &nbsp; &nbsp;&nbsp;</span>上面龙鑫个性定制酒刘经理所举的例子还只不过是一部分成功个人所要进行的定制，不排除将来一些组织也会加入到这种定制的群体中来，以用于团体的使用。</span><br />\n<span style=\"font-size:14px;\"><span style=\"font-size:14px;line-height:21px;\">&nbsp; &nbsp; &nbsp;&nbsp;</span>随着中国经济的高速发展，很多消费者手中可自由支配的资金会越来越多，再加上这些消费者对健康、个性的要求标准越来越高，从而为催生高端定制酒提供了土壤。</span><br />\n<span style=\"font-size:14px;\"> <span style=\"font-size:14px;line-height:21px;\">&nbsp; &nbsp; &nbsp;&nbsp;</span>但是，这种定制严格意义上讲，已经脱离了投资的范畴，而且不以即时消费为主，这部分消费者更多的是为了满足个性化和对产品品质本身的追求。</span><br />\n<span style=\"font-size:14px;\"><span style=\"font-size:14px;line-height:21px;\">&nbsp; &nbsp; &nbsp;&nbsp;</span>所以，现在对消费者来讲，是一个最好的时代，因为有这么多的酒类品牌和产品可以选择;但是也是一种最差的时代，因为巨大的信息量使他们已经不知该如何选择。</span><br />\n<span style=\"font-size:14px;\"></span>',NULL),(24,'新闻','个性定制酒凸显十足霸气',NULL,NULL,'1458180755342','1458180758186',NULL,'2016-03-17 10:09:22','<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; 现在的酒市场可谓前景广阔，且百家争鸣，要想在这片土壤上活下来，每种酒都得有自己的亮点。随着人们生活的提高，人们不仅追求的是物质上的享受，更多的是精神上的享受。而白酒行业目前的个性定制酒就抓住了人们的这一种心理，让我们普通的消费者也可以感受到定制酒的魅力。</span><br />\n<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;个性定制酒的厂家选择至关重要，厂家的水平决定着定制酒的质量和水平。所以在选择商家时一定要选择正规的厂家。</span><br />\n<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;定制白酒，是彰显您身份和地位的一种象征。在结婚时，选择婚宴定制酒，那是何等的甜蜜；在老人寿宴时，选择喜宴定制酒，那是何等的孝心；在送礼时，选择定制礼品用酒，那是何等的霸气。</span><br />\n<span style=\"font-size:14px;\"></span><span style=\"font-size:14px;\"></span><br />\n<span style=\"font-size:14px;\"></span>',NULL),(25,'新闻','个性定制酒的五个重要优势',NULL,NULL,'1458283685035','1458283687800',NULL,'2016-03-18 14:45:48','<span style=\"font-size:14px;\">个性定制酒比普通用酒的优势有许许多多，下面五个优势：</span><br />\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">优势一、专属服务/恭候私享：每一款\"定制酒\"，都实施行“一对一”顾问式对接，专人专线，从售前咨询，到售后跟踪，根据不同类型的客户，提供各种\"定制酒\"解决方案，配套产品及增值服务。&nbsp;</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">优势二、杜绝假劣/品质至上：每一款“定制酒”，从酿制到品调，均由大师严格甄选与把关，国家一级检测保障，堪称琼浆玉液。且从厂家直接销售到顾客手里，避免中间环节变数，杜绝假酒、品质卓著。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">优势三、深度宣传/提升形象：每一款定制酒，即可宴会招待、又可商务馈赠、即可饮用品尝、又可纪念收藏、提升品牌形象，显企业实力，是宣传推广的新媒介，是礼尚往来的选择。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">优势四、低调奢华/尊贵不贵：每一款\"定制酒\"，都直接针对消费者，减少了零售流通环节产生的费用。直接让利给客户，使产品物超所值，帮助企业降低公关、营销成本、理性消费，一样事半功倍。&nbsp;</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">优势五、量身定制/彰显实力：每一款定制酒，都可根据客户的意愿，消费偏好，企业文化特征，将个性化元素融入到酒瓶及酒盒，镌刻上客户的专属烙印，风格迥异，品味独到，且充满创意。&nbsp;</span>\n</p>\n<span style=\"font-size:14px;\"></span>',NULL),(26,'新闻','龙鑫定制酒的流程及具体步骤',NULL,NULL,'1458284243383','1458284246773',NULL,'2016-03-18 14:46:31','<span style=\"font-size:14px;\">第一步：客户首先选择要定制的产品款式。</span><br />\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">第二步：客户提供需要个性化定制的个性化元素（如：公司名称、企业LOGO、企业口号、董事长寄语、姓名、照片等）。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">第三步：由本公司个性定制酒设计师根据提供的个性化元素设计产品效果图、或由客户自 行设计效果图。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">第四步：客户签名确认产品效果图。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">第五步：客户预付产品生产金额的50%的货款、开始安排生产、周期根据产品的款式和数量不同、一般需要1—40天。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\">第六步：按约定地点按时交货、外地客户在发货前需付清余款的50%</span>\n</p>\n<span style=\"font-size:14px;\">&nbsp;</span><br />\n<span style=\"font-size:14px;\"></span><span style=\"font-size:14px;\"></span><br />\n<span style=\"font-size:14px;\"></span>',NULL),(27,'新闻','个性定制酒未出现行业规范还需谨慎',NULL,NULL,'1458716121828','1458716124734',NULL,'2016-03-23 14:02:13','<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp; 随着消费群体的个性化需求逐步明朗，定制用酒消费增长迅速。记者昨日调查发现，在定制酒风生水起的同时，标准缺失、产品良莠不齐等也被不少消费者质疑。业内人士提醒，目前定制酒消费尚无相关标准加以规范，消费者定制时还需谨慎。</span><br />\n<br />\n<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; 今年包括茅台、泸州老窖在内的众多酒企扎堆发力，定制酒“大战”再次白热化。记者采访中了解到，目前，定制酒从原酒、酒瓶、外包装盒都可为消费者度身打造。其中，定制白酒通常以500毫升装为主，其原酒价格也是按500毫升为单位来计算，售价从五六十元至数百元不等。以一定制酒销售企业推出的喜宴用酒为例，其瓶体上、包装上都可印有图像、祝福语等内容，并灌装、标注酒精度为“52.0度”，代表着“我爱你”。</span><br />\n<br />\n<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;不过，记者在采访中也发现，虽然定制酒“噱头十足”，但由于酒品质量良莠不齐等因素叠加，让部分消费者对于定制酒消费颇为质疑。“个性定制酒看上去很美，但其酒品质量如何，作为普通消费者很难判断，明明白白消费有点难。”家住欣园里的市民董先生告诉记者，看到朋友印有婚纱像的喜宴定制酒颇为动心，也想给父亲的寿宴定制几瓶白酒。不过，他咨询后发现定制酒消费并没有想象中容易。“酒瓶打上名字、照片之类就成了定制酒，可酒品的质量如何，我根本无从知晓。此外，通过网络定制，一旦发生纠纷难以维权。”董先生表示，虽然商家一再保证酒品质量，但其食用安全还是很担心。</span><br />\n<br />\n<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;此外，记者注意到，发货周期长，定金难退等诸多的“条条框框”也成个性酒消费待解难题。记者昨日以定制喜酒名义联系到一家定制酒销售企业。据销售人员介绍，由于个人定制酒从包装到原酒都根据需求量身打造，因而通常发货周期在1个月左右。此外，在交纳50%货款后才能正式生产，一旦消费者中途取消定制，定金一般不予退回。</span><br />\n<br />\n<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;业内人士表示，目前接受酒类定制的企业仍以中小企业为主，存在原酒产地不明、标准缺失、重新灌装质量难控等情况，消费者在进行定制酒消费时还需谨慎。同时，很多定制酒业务通过网络完成，无法做到定制信息公开透明。因而，消费者最好对定制酒企业有所了解，并对酒品的定制内容以合同形式进行详细说明与约定，一旦发生纠纷以便维权。</span><br />',NULL),(28,'新闻','喜宴定制酒掀起专属私人定制狂潮',NULL,NULL,'1458716126937','1458716128984',NULL,'2016-03-23 14:05:48','<p>\n\t<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp; 随着《私人定制》电影的热映，现在越来越多的人喜欢私人定制的东西，那种专属于自己的稀缺性与尊贵感让无数消费者为之倾倒，掀起私人定制的热潮。喜宴定制高端酒无疑引爆了众消费者的眼球。一种新型的个性化的酒文化大行其道，创新中国白酒行业的新时代来到了。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<div style=\"text-align:center;\">\n\t<span style=\"font-size:14px;line-height:1.5;color:#003399;\"><strong>喜宴定制酒让婚礼从此与众不同</strong></span>\n</div>\n<p>\n\t<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;高端白酒定制中心，是以茅台镇酒厂为依托，在北京设立营销中心、辐射全国、为全国各地酒友爱好者和酒类 经销提供个性化专属定制和贴牌(OEM)服务。为酒为媒，融入个性化的私属专享，可是以新人的结婚照、生活写真，签名、爱的密语等等，雕刻在酒瓶上或是酒 盒之上，尽显个性与奢华，这份尊贵的专属定制是唯一的、稀缺的也是可以鉴定永恒的。用这种酒来招待客人自然显得更加高端大气有品味。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><span style=\"font-size:14px;\"></span><br />\n</span>\n</p>\n<div style=\"text-align:center;\">\n\t<strong><span style=\"font-size:14px;color:#003399;\">多种创意尽显奢华与时尚</span></strong>\n</div>\n<p>\n\t<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp; 由国内一流设计师为您量身打造的包装配合浓厚的文化底蕴，让客户尊享“一站式”私人定制服务，高端、唯美、浪漫、时尚等等不同的设计元素与酒文化相得益彰，让消费者体会到一种别样的尊贵与个性，从此让婚礼变得不再雷同。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<div style=\"text-align:center;\">\n\t<span style=\"font-size:14px;line-height:1.5;color:#003399;\"><strong>喜宴定制酒用品质代言</strong></span>\n</div>\n<p>\n\t<span style=\"font-size:14px;\"> 来自中国酒都茅台镇的酱香白酒生产，和国酒茅台享有同根同源的资源优势，酿造出高品质的酱香型白酒，品质得到了保障，从而保证了客户的饮用安全与健康。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<div style=\"text-align:center;\">\n\t<span style=\"font-size:14px;line-height:1.5;color:#003399;\"><strong>贴心的售前售中售后服务赢得口碑</strong></span>\n</div>\n<p>\n\t<span style=\"font-size:14px;\"> 龙鑫喜宴定制中心全方位为客户提供售前、售中、售后服务，并根据不同客户的实际需求，免费提供打样设 计、加工生产到物流配送等服务，为客户提供一对一的贵宾定制服务，尊重每位客户的风格和实际需求，根据客户意愿提供样稿，进行一对一的交流与沟通，直到客 户满意为止。</span>\n</p>\n<p>\n\t<span style=\"font-size:14px;\"><br />\n</span>\n</p>\n<span style=\"font-size:14px;\">随着人们生活水平的提高，越来越多的消费者更需要属于自己个性化定制的产品。客户尊享“一站式”私人定制服 务，以及高贵礼遇的务社交生活方式，会成为一种新型的消费模式。笔者有理由相信，白酒定制会成为白酒业强势崛起的新贵，会快速的占领白酒市场，开创一个私 人定制白酒的新时代!</span><br />\n<span style=\"font-size:14px;\"></span><span style=\"font-size:14px;\"></span><br />',NULL),(29,'新闻','选择送个性定制酒，是一门学问',NULL,NULL,'1458716037825','1458716040778',NULL,'2016-03-23 14:50:59','<p>\n\t<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;送礼，并不是送过去就好了，送礼需要讲究时间恰当，间隔合适，送礼不能够明显的表现出自己的目的性，在中国都崇尚礼尚往来，一般你送礼过去，别人要么还你人情，要么还你礼品，中国的习俗让我们在送礼中需要注意很多的事项。定制酒本身就是独特的，具有特色的礼品，但是送礼的时候，需要做到合适恰当，比如在重大节假日的时候送礼，没有能够拒绝的理由，也没能够明确的表达自己的目的性，这样的含蓄，才是中国的习俗，也是中国人能够接受的收礼方式。</span><br />\n<span style=\"font-size:14px;\">&nbsp; &nbsp; &nbsp; &nbsp;个性定制酒能够展现出个人的特色，在送别人礼物的时候，适合的才是最好的，酒本身就是一件艺术品，浓醇的香味是酒的特点，如果酒是艺术品，那么个性定制酒可以说是一件保质保量的完美的艺术品。</span><br />\n<span style=\"font-size:14px;\"></span><span style=\"font-size:14px;\"></span>\n</p>',NULL);

