DROP TABLE IF EXISTS `products`;
CREATE TABLE `products` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `images` longtext COLLATE utf8_unicode_ci,
  `short_desc` longtext COLLATE utf8_unicode_ci,
  `tags` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `alcohol_degree` int(11) DEFAULT NULL,
  `ml` int(11) DEFAULT NULL,
  `reseller_mark` double DEFAULT NULL,
  `flavor` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `production_city` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `brand` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `source` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `total_weight` double DEFAULT NULL,
  `production_license` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `factory_location` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `price` double DEFAULT NULL,
  `ref_price` double DEFAULT NULL,
  `original_price` double DEFAULT NULL,
  `is_hot_sale` tinyint(1) DEFAULT '0',
  `sold_number` int(11) DEFAULT NULL,
  `thumb_up` int(11) DEFAULT NULL,
  `preview_image` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `product_image` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `bottle_spec` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `decoration` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `can_paint` tinyint(1) DEFAULT '0',
  `can_carve` tinyint(1) DEFAULT '0',
  `description` longtext COLLATE utf8_unicode_ci,
  `spec` longtext COLLATE utf8_unicode_ci,
  `notice` longtext COLLATE utf8_unicode_ci,
  `comment` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at_str` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=150 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

